Мой психиатр сказал что я не смогу покорить весь мир. Наивный раб!

    Диплом первой степени "За глубокую режиссерско-педагогическую работу по воспитанию актера в спектакле "Злой мальчик" (А.П. Чехов) на городском смотре театров малых форм "Дни театра в Зеркальном" (2007 г.);

    Диплом за талантливое сценическое воплощение русской классики и творческий вклад на городском фестивале детских театральных коллективов "Дни театра в Зеркальном" (2007 г.);

    Диплом XV городского фестиваля "Дни театра в Солнечном" за гибкость мысли в подходе к материалу и неповторимую пластическую выразительность в спектакле "История шамана" (2009 г.);

    Диплом участника международного фестиваля "Слово и Тело" за режиссерское решение и за авторское воплощение актуальных проблем современности в спектакле "Зеркало" (2011 г.);

    Диплом первой степени в рамках II международного фестиваля-конкурса "Евразия–2012", организованного в Париже, Невере и Озуар-Ле-Феррьер, за спектакль "Чемоданчик" (2012 г.);

    Диплом XIII международного брянцевского фестиваля детских театральных коллективов за спектакль "Зеркало" (2012 г.).
